import React from "react";
import Header from "../header/Header";
const CreateRoadMaps = () => {
  return (
    <>
      <Header />
      <div className="roadmap-wrapper">
        <select>To Do</select>
        <div className="assigned-to-wrapper"></div>
        <div className="priority-wrapper"></div>
        <div className="roadmap-title"></div>
        <div className="roadmap-description"></div>

        <div className="checklist-wrapper"></div>
        <div className="attachments-wrapper"></div>
        <div className="due-date"></div>
        <div className="comments"></div>
      </div>
    </>
  );
};

export default CreateRoadMaps;
